/*CREATE TABLE promotions (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор акции',
  `start_date` datetime NOT NULL COMMENT 'Дата начала акции',
  `end_date` datetime NOT NULL COMMENT 'Дата окончания акции',
  `discount` int(11) NOT NULL COMMENT '% скидки',
  `bonuse` int(11) NOT NULL COMMENT 'Бонусы',
  `description` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Акции';*/

DESCRIBE promotions;
-- Обновить инфорамацмю в таблице "Акции", после вставки данных.
-- 
-- Обновляем дату создания записи
UPDATE promotions SET created_at=DATE_FORMAT(created_at,'2020-%m-%d %T');
-- 
-- Обновляем дату начала акции
UPDATE promotions SET start_date=DATE_FORMAT(created_at,'2020-%m-%d %T');
-- 
-- Обновляем дату окончания акции 
UPDATE promotions SET end_date = ADDDATE(start_date, INTERVAL 15 DAY);
-- 
-- Обновляем % скидки
UPDATE promotions SET discount = FLOOR(1 + (RAND() * 10));


